import './App.css';
import Footer from './components/Footer';
import Header from './components/Header';
import Home from './Pages/Home';
import Eco from './Pages/Eco';
import Road from './Pages/Road';
import VerticalMode from "./components/slider";
import FaqPage from './Pages/FaqPage';
import TeamPage from './TeamPage';
import {BrowserRouter as Router, Route, Link, Routes,Layout} from 'react-router-dom';



function App() {
  return (
  <>
  <Header />
  {/* <Home />
  <Eco></Eco>
  <Road></Road>
  <VerticalMode/>
<TeamPage></TeamPage>
<FaqPage></FaqPage> */}

<Router>
      <Layout>
        <Routes>
<Route path="/Eco">
  <Eco />
</Route>
<Route path="/Road">
  <Road />
</Route>
<Route path="/VerticalMode">
  <VerticalMode />
</Route>
<Route path="/TeamPage">
  <TeamPage />
</Route>
<Route path="/">
  <Home />
</Route>
</Routes>
      </Layout>
        </Router>
  <Footer />
  </>
  );
}

export default App;
